class BorderPaint{static pipe(...a){return function(b){return a.reduce((a,b)=>b(a),b)}}static getHue(){return Math.floor(101*Math.random())+190}static getDirectionInRadians(){return Math.random()*Math.PI}static getHypoLength(a){return 10/Math.cos(a)}static getCoord(a){const b=0>a?-1:1,c=Math.sqrt(a*a-100);return c*b}static getWidth(){return Math.floor(10*Math.random())+2}paint(a,b,c){for(let d=0;49>d;d+=1){const b=BorderPaint.getDirectionInRadians(),c=BorderPaint.pipe(BorderPaint.getHypoLength,BorderPaint.getCoord,Math.round)(b),e=6*d;a.beginPath(),a.moveTo(e,425),a.lineTo(e+c,435),a.lineWidth=BorderPaint.getWidth(),a.strokeStyle=`hsl(${BorderPaint.getHue()}deg, 85%, 49%)`,a.stroke()}}}registerPaint("borderPaint",BorderPaint);